/* start : prim_mat_transpose_square	
	name:
		prim_mat_transpose_square
	info:
		Transposes a sqare matrix of size==nr_cells.
		Algorithm goes through the matrix, one diagonal at a time.
	requiremens hardware:
		`define ARRAY_NR_CELLS (16)
		min `define RESOURCE_CTRL_CELL_STACK_SIZE (3)
		`define RESOURCE_ARRAY_HAS_BW_SCAN_NET (1)
			`define RESOURCE_NET_HAS_OPERATION_PERMUTE (1)
		`define RESOURCE_NETWORK_HAS_SCAN_MODE_SELECTION (1) 
			or
		`define RESOURCE_NETWORK_SINGLE_SCAN_MODE (`NETWORK_SCAN_MODE_ONE_SHOT_MEM_OUT)
	requirements variables/parameters locations:
		3 parameters, stored at : 
			CODE_PRIM_MAT_TRANSPOSE_SQUARE_DATA_IN_LOCATION : stored in ctrl memory : location from array mem where initial matrix is found (offset)
			CODE_PRIM_MAT_TRANSPOSE_SQUARE_DATA_OUT_LOCATION : stored in ctrl memory : location from array mem where result is stored (offset)
			CODE_PRIM_MAT_TRANSPOSE_SQUARE_BWBITS_LOCATION : stored in ctrl memory : location from array mem where bw permutation bits are found (offset)
		requires 2 matrices :
			bw permutation bits
			data to transpose 
	uses:
	    label 10_227 - function start;
	    label 10_228 - main loop 
//*/ 
//*	// code			

	`define CODE_PRIM_MAT_TRANSPOSE_SQUARE_DATA_IN_LOCATION (`CONTROLLER_INSTR_MEM_SIZE/2 -1)
	`define CODE_PRIM_MAT_TRANSPOSE_SQUARE_DATA_OUT_LOCATION (`CODE_PRIM_MAT_TRANSPOSE_SQUARE_DATA_IN_LOCATION -1)
	`define CODE_PRIM_MAT_TRANSPOSE_SQUARE_BWBITS_LOCATION (`CODE_PRIM_MAT_TRANSPOSE_SQUARE_DATA_OUT_LOCATION -1) 
	`define CODE_PRIM_MAT_TRANSPOSE_SQUARE_ARRAY_BASE_ADDR_REG_LOCATION (`CODE_PRIM_MAT_TRANSPOSE_SQUARE_BWBITS_LOCATION -1) 


LB(10_227);
	cVLOAD(-1);																	ADDR_REG_STACK_DUPLICATE;
	cSETDEC;																	NOP;
	cVLOAD(`ARRAY_NR_CELLS);													NOP;
	cVSUB(1);																	NOP;
	cSETCompVal;																NOP;
	cPARAM;																		NOP;
	cRSTORE(`CODE_PRIM_MAT_TRANSPOSE_SQUARE_DATA_IN_LOCATION);					NOP;
	cPARAM;																		NOP;
	cRSTORE(`CODE_PRIM_MAT_TRANSPOSE_SQUARE_DATA_OUT_LOCATION);					NOP;
	cPARAM;																		NOP;
	cRSTORE(`CODE_PRIM_MAT_TRANSPOSE_SQUARE_BWBITS_LOCATION);					NOP;
	cVLOAD(0);																	VLOAD(9995);
	
LB(10_228);
	cSTACK_DUPLICATE;															ADDR_REG_STACK_POP;
	cRADD(`CODE_PRIM_MAT_TRANSPOSE_SQUARE_BWBITS_LOCATION);						ADDR_REG_STACK_DUPLICATE;
	cSTACK_POP;																	CADDRINC;
	cNOP;																		NOP;				// aici cred ca pot sa pun deja acel pop
	cNOP;																		SCANPERMUTE(2);
	cNOP;																		ADDR_REG_STACK_POP;
	cNOP;																		ADDR_REG_STACK_DUPLICATE;
	cNOP;																		IXLOAD;
	cNOP;																		CADD;
	cSTACK_DUPLICATE;															VAND(`ARRAY_NR_CELLS-1);
	cRLOAD(`CODE_PRIM_MAT_TRANSPOSE_SQUARE_DATA_IN_LOCATION);					ADDRINC_ACC;
	cNOP;																		CADDRINC;
	cSTACK_POP;																	NOP;
	cNOP;																		RLOAD(0);	// permute network start 
	cNOP;                   													ADDR_REG_STACK_POP;
	cNOP;                                           							ADDR_REG_STACK_DUPLICATE;
	cNOP;                                         								IXLOAD;
	cNOP;                                          								CSUB;
	cSTACK_DUPLICATE;                                          					VAND(`ARRAY_NR_CELLS-1);
	cRLOAD(`CODE_PRIM_MAT_TRANSPOSE_SQUARE_DATA_OUT_LOCATION);					ADDRINC_ACC;
	cSTACK_POP;                                           						CADDRINC;
	cNOP;                                           							NOP;			
	cNOP;                                           							SCANLOAD;
	cBRNValDEC(10_228);															RSTORE(0);
	
	cNOP;																	ADDR_REG_STACK_POP;
	cSEL_ADDRREG(0);														NOP;
	
	cHALT;																	NOP;
//*/ // end : prim_mat_transpose_square










